import React,{Component} from "react";
import './Project_two.css';
import img from './Elite_Homes.png';

class Project_two extends Component {
    render() {
        return(
            <div className="Main-Project_two">
                <img src={img} alt="Elite Homes_ss_here" width={"370px"} height={"230px"}/>
                <div className="Project_one_text">
                <h1>My Portfolio</h1>
                <p>Portfolio is a design that speaks for me. It is created with the help of languages like React JS, CSS etc.</p></div>
            </div>
        )
    }
}

export default Project_two;
